WORDS = DATA.read.split("\n").map(&:chars)
H = WORDS.size
W = WORDS[0].size

def check(x, y)
  return false if WORDS[y][x] != 'A'
  return false if x <= 0 || x >= W-1 || y <= 0 || y >= H-1

  (
    WORDS[y - 1][x - 1] == 'M' && WORDS[y - 1][x + 1] == 'M' && WORDS[y + 1][x - 1] == 'S' && WORDS[y + 1][x + 1] == 'S'
  ) || (
    WORDS[y - 1][x - 1] == 'S' && WORDS[y - 1][x + 1] == 'S' && WORDS[y + 1][x - 1] == 'M' && WORDS[y + 1][x + 1] == 'M'
  ) || (
    WORDS[y - 1][x - 1] == 'M' && WORDS[y - 1][x + 1] == 'S' && WORDS[y + 1][x - 1] == 'M' && WORDS[y + 1][x + 1] == 'S'
  ) || (
    WORDS[y - 1][x - 1] == 'S' && WORDS[y - 1][x + 1] == 'M' && WORDS[y + 1][x - 1] == 'S' && WORDS[y + 1][x + 1] == 'M'
  )
end

ans = 0

H.times do |y|
  W.times do |x|
    if check(x, y)
      ans += 1
    end
  end
end

puts ans

__END__
